O curso de Redação Oficial com Foco na Elaboração de Documentos Técnicos - Inteligência Artificial na Produção e Análise de Documentos Técnicos na Administração Pública, almeja o treinamento e aperfeiçoamento dos servidores nos temas listados abaixo: 
Introdução à redação oficial;
O manual de redação da presidência da república (MPRP);
Qualidades e vícios de linguagem;
Características essenciais das comunicações oficiais;
Aspectos comuns às diversas modalidades de comunicações oficiais.

O Curso deverá ocorrer nos dias 09, 10 e 11 de Abril de 2025,  conforme o Folder (0058683588). Os serviços serão executados na cidade de Curitiba, na modalidade presencial, em dependências ofertada pela contratada;
Local do evento: HOTEL MABU CURITIBA BUSINESS R. XV DE NOVEMBRO, 830 - CENTRO, CURITIBA - PR;
Data: 09, 10 e 11 de abril de 2025 ;
Carga Horária: 12 Horas ;
Duração: 03 (três) dias ;
Professora: Suzana Gonçalves.
